import React, { Component } from 'react';
//import React from "react";
import Icon from '@material-ui/core/Icon';
import "./App.css";
import "./App.scss";
//import {BrowserRouter as Router,Route} from 'react-router-dom';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import Main from './components/assure/main';
//import user from './user';
import { Link } from 'react-router-dom';
import Conn from './Conn';
import MenuIcon from '@material-ui/icons/Menu';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import PowerSettingsNewIcon from '@material-ui/icons/PowerSettingsNew';
import IconButton from '@material-ui/core/IconButton';


const useStyles = makeStyles(theme => ({
  button: {
    margin: theme.spacing(1),
  },
  input: {
    display: 'none',
  },
}));




class App extends Component {

  render() {





    return (

    //  const classes = useStyles();
      <div className="demo-big-content">
    <Layout>
        <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/app/assure"><MenuIcon/>Mon Espace Assurance</Link>} scroll>
            <Navigation>
                <Link to="/app/assure/resume">Profile Assurance</Link>
                <Link to="/app/assure/projects">Biens Assurés</Link>
                <Link to="/app/assure/aboutme">Sinistre en Cours</Link>
                <Link to="/app/assure/contact">Contact</Link>
                <IconButton  aria-label="delete">
                 Déconnection <PowerSettingsNewIcon/>
                </IconButton>
            </Navigation>
        </Header>
    <Drawer  title={<Link style={{textDecoration: 'none', color: 'black'}} to="/app/assure"> <MenuIcon/>Mon Espace</Link>}>
            <Navigation>

              <Link to="/app/assure/resume">Profile Assurance</Link>
               <Link to="/app/assure/projects">Biens Assurés</Link> 
              <Link to="/app/assure/aboutme">Sinistre en Cours</Link>
              <Link to="/app/assure/contact">Deconnexion</Link>
            </Navigation>
        </Drawer>

        <Content>
            <div className="page-content" />
           <Main/>
        </Content>
    </Layout>
</div>

    );
  }
}



export default App;
